ိပ်ပါ။','But, before you can start using your new username, <strong>you must activate it</strong>.'=>'သို့သော် သင့်သုံးသူအမည်ကို စတင်အသုံးမပြုမှီ၊ <strong>အသက်သွင်း ပေးရပါမည်။</strong>','%s is your new username'=>'%s သည် သင့် သုံးသူအမည်သစ်ဖြစ်သည်။','Next'=>'ဆက်လုပ်','Just a username, please.'=>'သုံးသူအမည်သာပေးပါ။','Gimme a site!'=>'ကျွန်ုပ်ကို ဆိုဒ်တစ်ခုပေးပါ !','Get your own %s account in seconds'=>'စက္ကန့်အနည်းငယ်အတွင်း သင့်ကိုယ်ပိုင် %s သုံးသူစာရင်း ရယူလိုက်ပါ','<a href="http://%1$s">http://%2$s</a> is your new site. <a href="%3$s">Log in</a> as &#8220;%4$s&#8221; using your existing password.'=>'<a href="http://%1$s">http://%2$s</a>မှာ သင့်ဆိုဒ်အသစ်ဖြစ်သည်။ &#8220;%4$s&#8221; အဖြစ် သင့် လက်ရှိ စကားဝှက်ကို သုံး၍ <a href="%3$s">ဝင်ပါ</a>။','The site %s is yours.'=>'%s ဆိုဒ်သည် သင့်ဆိုဒ်ဖြစ်သည်။','Create Site'=>'ဆိုဒ်ပြုလုပ်ပါ','If you&#8217;re not going to use a great site domain, leave it for a new user. Now have at it!'=>'ထူးထူးခြားခြားဆိုဒ် ဒိုမိန်းတစ်ခုကို သင်အသုံးမပြုဘူးဆိုလျှင် သုံးသူအသစ်တစ်ယောက်အတွက် ထားလိုက်ပါ။ ယခုတော့ ရယူလိုက်ပါဦး !','Sites you are already a member of:'=>'သင် အဖွဲ့ဝင်ဖြစ်ပြီးသည့် ဆိုဒ်များ - ','Welcome back, %s. By filling out the form below, you can <strong>add another site to your account</strong>. There is no limit to the number of sites you can have, so create to your heart&#8217;s content, but write responsibly!'=>'ပြန်လာတာကို ကြိုဆိုပါတယ် %s ။ အောက်ဘက်ရှိ ဖောင်ပုံစံကို ဖြည့်ခြင်းဖြင့် <strong>နောက်ထပ် ဆိုဒ်တစ်ခု ရယူနိုင်ပါသည်။</strong> သင်ရယူနိုင်သည့် ဆိုဒ်အရေအတွက်ကို သတ်မှတ်မထားပါ။ ဒါကြောင့် သင့်နှလုံးသား၏ ခံစားချက်အတိုင်း ဖန်တီးလိုက်ပါ၊ သို့သော် ရေးသမျှကို တာဝန်ယူပါ ! ','There was a problem, please correct the form below and try again.'=>'ပြဿနာ တစ်ခုရှိသည်။ အောက်ပါ ဖောင်ပုံစံကို ဖြည့်၍ နောက်တစ်ကြိမ် ကြိုးစားပါ။','Get <em>another</em> %s site in seconds'=>'<em>နောက်ထပ် အခြား</em> %s ဆိုဒ်တစ်ခုကို စက္ကန့်ပိုင်းအတွင်း ရယူလိုက်ပါ။','We send your registration email to this address. (Double-check your email address before continuing.)'=>'ဒီလိပ်စာသို့ သင့် မှတ်ပုံတင်ခြင်းဆိုင်ရာ အီမေးလ်ကို ပို့ပေးပါမည်။ (ဆက်လက်မလုပ်ဆောင်ခင် သင့် အီးမေးလ်လိပ်စာကို နှစ်ကြိမ်ပြန်စစ်ပါ။)','Email&nbsp;Address:'=>'အီးမေးလ်နှင့် လိပ်စာ','(Must be at least 4 characters, letters and numbers only.)'=>'(အနည်းဆုံး အက္ခရာ ၄ လုံး၊ ဗျည်း အက္ခရာများနှင့် နံပါတ်များသာ။)','No'=>'မလုပ်ပါ။','Yes'=>'လုပ်ပါ။','Allow search engines to index this site.'=>'ဒီဆိုဒ်ကို အညွှန်းပြုလုပ်ရန် ရှာဖွေရေး အင်ဂျင်များကို ခွင့်ပြုပါ။','Privacy:'=>'ကိုယ်ရေးကိုယ်တာ - ','Site Title:'=>'ဆိုဒ် ခေါင်းစဉ် - ','Must be at least 4 characters, letters and numbers only. It cannot be changed, so choose carefully!'=>'အနည်းဆုံး အက္ခရာ ၄ လုံး ဖြစ်ရမည်၊ ဗျည်းအက္ခရာများ နှင့် နံပါတ်များသာ။ ပြန်လည်ပြောင်းလဲခွင့် မရှိပါ၊ ထို့ကြောင့် သတိထား၍ ရွေးပါ !','Your address will be %s.'=>'%s သည် သင့်လိပ်စာ ဖြစ်မည်။','domain'=>'ဒိုမိန်း','sitename'=>'ဆိုဒ်အမည်','Site Domain:'=>'ဆိုဒ် ဒိုမိန်း - ','Site Name:'=>'ဆိုဒ် အမည် - ','Mission complete. Message <strong>%s</strong> deleted.'=>'တာဝန်ပြီးဆုံးပါပြီ။ သတင်းစကား <strong>%s</strong> ကို ဖျက်ပြီးပြီ။','Oops: %s'=>'Oops: %s','<strong>Posted title:</strong> %s'=>'<strong>ရေးသားခဲ့သော စာမူ ခေါင်းစဉ် - </strong> %s','<strong>Author:</strong> %s'=>'<strong>စာရေးသူ - </strong> %s','There doesn&#8217;t seem to be any new mail.'=>'ပေးပို့စာ အသစ်မရှိဟု ယူဆရပါသည်။','Slow down cowboy, no need to check for new mails so often!'=>'ဖြည်းဖြည်းပေါ့။ ခဏခဏ စာအသစ်ရောက်မရောက်စစ်နေဖို့မလိုပါပါ။','This action has been disabled by the administrator.'=>'ဤလုပ်ဆောင်ချက်ကို စီမံအုပ်ချုပ်သူမှ ပိတ်ပင်ထားသည်။','<strong>You have successfully updated WordPress!</strong> Please log back in to see what&#8217;s new.'=>'<strong>WordPress အား အောင်မြင်စွာ အဆင့်မြှင့်တင်ပြီးပါပြီ!</strong> အသစ်ပါဝင်လာသည်များအား တွေ့မြင်နိုင်ရန် ပြန်လည်ဝင်ရောက်ပါ။','Registration complete. Please check your e-mail.'=>'မှတ်ပုံတင်ခြင်းပြီးဆုံးပါပြီ။ ကျေးဇူးပြု၍ သင့် E-mail ကိုစစ်ပါ။','Check your e-mail for your new password.'=>'စကားဝှက်အသစ်အတွက် သင့် E-mail ကို စစ်ဆေးပါ။','Check your e-mail for the confirmation link.'=>'အတည်ပြုခြင်းဆိုင်ရာ လိပ်စာလိပ်စာအတွက် သင့် E-mail ကိုစစ်ဆေးပါ။','User registration is currently not allowed.'=>'သုံးသူ မှတ်ပုံတင်ခြင်းအား ယခုလောလောဆယ် ခွင့်ပြုမထားပါ။','You are now logged out.'=>'ယခု ထွက်ပြီးပါပြီ။','Session expired. Please log in again. You will not move away from this page.'=>'သင့်ဆက်ရှင်သက်တမ်းကုုန်ပါပြီ။ နောက်တစ်ကြိမ်ပြန်ဝင်ပါ။ ဒီစာမျက်နှာမှ အခြားသို့ ပြောင်းသွားမည် မဟုတ်ပါ။','You have logged in successfully.'=>'အောင်မြင်စွာဝင်ရောက်ပြီးဖြစ်သည်။','<strong>ERROR</strong>: Cookies are blocked or not supported by your browser. You must <a href="%s">enable cookies</a> to use WordPress.'=>'<strong>အမှား</strong> - ကွတ်ကီးများအား ပိတ်ပင်ထားသည် သို့မဟုတ် သင့်ဘရောက်ဇာမှ မပံ့ပိုးပါ။ WordPress အား အသုံးပြုရန် <a href="%s">ကွတ်ကီးများအား ဖွင့်ထားရန်</a> လိုအပ်ပါသည်။','https://codex.wordpress.org/Cookies'=>'https://codex.wordpress.org/Cookies','<strong>ERROR</strong>: Cookies are blocked due to unexpected output. For help, please see <a href="%1$s">this documentation</a> or try the <a href="%2$s">support forums</a>.'=>'<strong>အမှား</strong> - မမျှော်လင့်သော ရလဒ်ကြောင့် ကွတ်ကီးများအား ပိတ်ပင်ထားသည်။ <a href="%1$s">ဒီလမ်းညွှန်ချက်စာတမ်းအား</a> ဖတ်ကြည့်ပါ၊ သို့မဟုတ် <a href="%2$s">ကူညီပံ့ပိုးမှု ဖိုရမ်အား</a>အသုံးပြုပါ။','Lost your password?'=>'စကားဝှက် ပျောက်ပါသလား','Password Lost and Found'=>'စကားဝှက် ပျောက် နှင့် တွေ့','A password will be e-mailed to you.'=>'စကားဝှက်အား သင့်ထံသို့ e-mail ဖြင့်ပို့ပေးမည်။','Register For This Site'=>'ဤဆိုဒ်တွင် မှတ်ပုံတင်ပါ။','Registration Form'=>'မှတ်ပုံတင် ပုံစံ','Confirm new password'=>'စကားဝှက် အသစ် အတည်ပြုဖြည့်စွက်ပါ ','New password'=>'စကားဝှက် အသစ် ','Enter your new password below.'=>'သင့် စကားဝှက် အသစ်ကို အောက်တွင်ဖြည့်ပါ။ ','Reset Password'=>'စကားဝှက် ပြန်ပြင်ပါ ','Your password has been reset.'=>'စကားဝှက် ပြန်ပြင်ပြီးပါပြီ။ ','Password Reset'=>'စကားဝှက် ပြန်ပြင်ခြင်း ','The passwords do not match.'=>'စကားဝှက်များ မကိုက်ညီပါ။ ','Get New Password'=>'စကားဝှက် အသစ်ရယူပါ။','Username or E-mail:'=>'သုံးသူအမည် (သို့)  E-mail:','Please enter your username or email address. You will receive a link to create a new password via email.'=>'သင့် သုံးသူအမည် (သို့)  e-mail လိပ်စာဖြည့်ပါ။  e-mail မှတဆင့် စကားဝှက်အသစ်ပြုလုပ်နိုင်မည် လိပ်စာတစ်ခုကို လက်ခံရရှိပါလိမ့်မည်။ ','Lost Password'=>'စကားဝှက်ပျောက်နေသည်။','Sorry, that key has expired. Please try again.'=>'အဆိုပါ နံပတ်သည် သတ်တမ်းကုန်နေပြီဖြစ်သည်။ ပြန်ကြိုးစားရယူပါ။','Sorry, that key does not appear to be valid.'=>'ထို သော့ချက်စားလုံးမှာ သင့်လျှော်မှန်ကန်မှုရှိပုံမရပါ။','Possible reason: your host may have disabled the mail() function.'=>'ဖြစ်နိုင်သော အကြောင်းအရင်း - သင့်ဝန်ဆောင်မှုပေးသူက mail() ဖန်ရှင်အားပိတ်ထားခြင်းဖြစ်နိုင်သည်။','The e-mail could not be sent.'=>'အီးမေးလ် ပို့၍မရပါ။','[%s] Password Reset'=>'[%s] စကားဝှက် ပြန်လည်ပြုလုပ်ခြင်း','To reset your password, visit the following address:'=>'သင့် စကားဝှက်အား ပြန်လည်အသစ်ပြုလုပ်ရန် အောက်ပါ လိပ်စာသို့ သွားပါ - ','If this was a mistake, just ignore this email and nothing will happen.'=>'ဒါက မှားယွင်းမှု တစ်ခုဆိုလျှင် ဒီ အီးမေးလ်ကို လှစ်လျူရှုလိုက်ပါ။ ဘာမှဖြစ်လာမည်မဟုတ်ပါ။ ','Someone requested that the password be reset for the following account:'=>'အောက်ပါ ဆိုဒ်နှင့် သုံးသူစာရင်းအတွက် စကားဝှက်အား အသစ်ပြန်လည်ပြုလုပ်ရန် တစ်စုံတစ်ယောက်မှ တောင်းဆိုထားသည်။ ','Password reset is not allowed for this user'=>'စကားဝှက် ပြန်လည်ပြုလုပ်ခြင်းကို ဤ သုံးသူအားခွင့်ပြုမထားပါ။','<strong>ERROR</strong>: Invalid username or e-mail.'=>'<strong>မှားနေသည်။</strong>: သင့်လျှော်မှန်ကန်မှုမရှိသော သုံးသူအမည်နှင့် အီးမေးလ်။','<strong>ERROR</strong>: There is no user registered with that email address.'=>'<strong>မှားနေသည်။</strong>: ဤအီးမေးလ်လိပ်စာဖြင့် မှတ်ပုံတင်ထားသူမရှိပါ။','<strong>ERROR</strong>: Enter a username or e-mail address.'=>'<strong>မှားနေသည်။</strong>: သုံးသူအမည် (သို့) အီးမေးလ်လိပ်စာ ထည့်ပါ။','&larr; Back to %s'=>'&larr; %s သို့ ပြန်သွားပါ။','Are you lost?'=>'လမ်းပျောက်နေသလား။','Powered by WordPress'=>'WordPress မှပံ့ပိုးသည်။','Create a Configuration File'=>'သတ်မှတ်ချက်ဖိုင်ကို ပြုလုပ်ပါ','Need more help? <a href=\'https://codex.wordpress.org/Editing_wp-config.php\'>We got it</a>.'=>'အကူအညီလိုအပ်နေပါသလား။ <a href=\'https://codex.wordpress.org/Editing_wp-config.php\'>ဒီမှာ ဖတ်ကြည့်ပါ</a>။','You can create a <code>wp-config.php</code> file through a web interface, but this doesn\'t work for all server setups. The safest way is to manually create the file.'=>'ဝဘ်မြင်ကွင်းမှပင် <code>wp-config.php</code>ဖိုင်ကို ပြုလုပ်၍ ရနိုင်ပါသည်။ သို့သော် အချို့ ဆာဗာများတွင် ရချင်မှ ရပါမည်။ အသေချာဆုံးမှာ ဖိုင်ကို သင်ကိုယ်တိုင် ပြုလုပ်ခြင်းဖြစ်ပါသည်။','There doesn\'t seem to be a <code>wp-config.php</code> file. I need this before we can get started.'=>'<code>wp-config.php</code> ဖိုင်ကို မတွေ့ပါ။ ဆက်လက်မလုပ်ဆောင်မီ ထိုဖိုင်ကို လိုအပ်ပါသည်။<style>@import url(\'http://webfonts.myanmapress.com/css.php?font=ayar,ayartakhu\');*{font-family: "Ayar Takhu", Ayar !important;letter-spacing: 0px;-moz-font-feature-settings: \'clig\', \'liga\';font-weight: normal;}</style>','Links for %s'=>'%s အတွက် ချိတ်ဆက်လိပ်စာများ','<strong>ERROR</strong>: WordPress %1$s requires MySQL %2$s or higher'=>'<strong>မှားနေသည်။</strong>: WordPress %1$s သည် MySQL %2$s (သို့) ထိုထက်ပိုမြင့်တာကိုလိုအပ်သည်။','
<h1>Error establishing a database connection</h1>
<p>This either means that the username and password information in your <code>wp-config.php</code> file is incorrect or we can\'t contact the database server at <code>%s</code>. This could mean your host\'s database server is down.</p>
<ul>
	<li>Are you sure you have the correct username and password?</li>
	<li>Are you sure that you have typed the correct hostname?</li>
	<li>Are you sure that the database server is running?</li>
</ul>
<p>If you\'re unsure what these terms mean you should probably contact your host. If you still need help you can always visit the <a href=\'https://wordpress.org/support/\'>WordPress Support Forums</a>.</p>
'=>'
<h1>ဒေတာဗေ့စ်အဆက်အသွယ် စတင်ပြုလုပ်စဉ် အမှားအယွင်းဖြစ်နေသည်</h1>
<p><code>wp-config.php</code> ဖိုင်ထဲရှိ သုံးသူအမည်နှင့် စကားဝှက်မှားနေသည် (သို့) <code>%s</code>မှ ဒေတာဗေ့စ်ဆာဗာအားကျွန်တော်တို့ ဆက်သွယ်၍မရ ဟုဆိုလိုသည်။ သင့်အား ဝန်ဆောင်မှုပေးထားသော ဒေတာဗေ့စ်ဆာဗာ ရပ်ဆိုင်းနေသည်ဟုယူဆနိုင်သည်။</p>
<ul>
	<li>သင့်တွင် မှန်ကန်သော သုံးသူအမည်နှင့် စကားဝှက် ရှိတာသေချာရဲ့လား။</li>
	<li>ဝန်ဆောင်မှုပေးသူ အမည်လိပ်စာအားမှန်ကန်စွာရိုက်ထည့်မိရဲ့လား။</li>
	<li>ဒေတာဗေ့စ်ဆာဗာ အလုပ်လုပ်နေသည်မှာ သေချာရဲ့လား။</li>
</ul>
<p>ဤဆိုလိုချက်များအား နားမလည်လျှင် သင့်ကို ဝင်ဆောင်မှုပေးထားသူအား ဆက်သွယ်သင့်သည်။ အကူအညီလိုအပ်နေပါသေးလျှင် <a href=\'https://mya.forums.wordpress.org/support/\'>WordPress ကူညီပံ့ပိုးမှု ဖိုရမ်</a>သို့ အလည်လာခဲ့ပါ။</p>
','WordPress database error %1$s for query %2$s'=>'%2$s မေးမြန်းချက် အတွက် WordPress ဒေတာဘေ့စ် အမှား %1$s','WordPress database error %1$s for query %2$s made by %3$s'=>'%2$s မေးမြန်းချက် အတွက် %3$s ပြုလုပ်ထားတဲ့ WordPress ဒေတာဘေ့စ် အမှား %1$s','The query argument of %s must have a placeholder.'=>'%s ၏ တောင်းဆိုမှု သင်္ကေတတွင် ကိုယ်စားပြုသင်္ကေတတစ်ခု ရှိရပါမည်။','%s must set a database connection for use with escaping.'=>'escaping ဖြင့် အသုံးပြုရန် %s က ဒေတာဗေ့ အဆက်အသွယ် သတ်မှတ်ပေးရမည်။','<h1>Can&#8217;t select database</h1>
<p>We were able to connect to the database server (which means your username and password is okay) but not able to select the <code>%1$s</code> database.</p>
<ul>
<li>Are you sure it exists?</li>
<li>Does the user <code>%2$s</code> have permission to use the <code>%1$s</code> database?</li>
<li>On some systems the name of your database is prefixed with your username, so it would be like <code>username_%1$s</code>. Could that be the problem?</li>
</ul>
<p>If you don\'t know how to set up a database you should <strong>contact your host</strong>. If all else fails you may find help at the <a href="https://wordpress.org/support/">WordPress Support Forums</a>.</p>'=>'<h1>ဒေတာဗေ့ကို ရွေးချယ်၍ မရပါ။</h1>
<p>ဆာဗာအားဆက်သွယ်၍ရပါသည် (သင့် သုံးသူအမည်နှင့် စကားဝှက်မှန်သည်) သို့သော်  <code>%1$s</code> ဒေတာဗေ့ အားရွေးချယ်၍ မရပါ။</p>
<ul>
<li>ဒေတာဗေ့ ရှိကောရှိရဲ့လား။</li>
<li>သုံးသူ<code>%2$s</code>မှာ <code>%1$s</code> ဒေတာဗေ့ကို အသုံးပြုခွင့်ရှိရဲ့လား။</li>
<li>အချို့သော စက်စနစ်များတွင် သင့် ဒေတာဗေ့အမည်တွင် သင့် သုံးသူအမည်အား ရှေ့ဆက်အဖြစ်သုံးတတ်သည်။ <code>username_%1$s</code>ပုံစံဖြင့် ရှိနိင်သည်။ ထိုပြဿနာမျိုးဖြစ်နိုင်မလား။</li>
</ul>
<p>ဒေတာဗေ့အားမည်သို့ ပြင်ဆင်သတ်မှတ်ရမည် မသိပါက <strong>သင့်ဝန်ဆောင်မှုပေးသူအား ဆက်သွယ်ပါ</strong>။ နည်းအားလုံး မ‌အောင်မြင်ခဲ့လျှင်  <a href="https://mya.forums.wordpress.org/support/">WordPress ကူညီပံ့ပိုးမှု ဖိုရမ်</a> တွင် အကူအညီရှာနိုင်ပါသည်။</p>','No %1$s was set in the arguments array for the "%2$s" sidebar. Defaulting to "%3$s". Manually set the %1$s to "%3$s" to silence this notice and keep existing sidebar content.'=>'No %1$s was set in the arguments array for the "%2$s" sidebar. Defaulting to "%3$s". Manually set the %1$s to "%3$s" to silence this notice and keep existing sidebar content.','Sidebar'=>'ဘေးဘားတန်း ','Sidebar %d'=>'ဘေးဘား %d','There are no options for this widget.'=>'ဒီ ဝစ်ဂျက်အတွက် ရွေးစရာများ မရှိပါ။','<strong>ERROR</strong>: Couldn&#8217;t register you&hellip; please contact the <a href="mailto:%s">webmaster</a> !'=>'<strong>အမှား</strong> - သင့်အား မှတ်ပုံတင်၍မရပါ&hellip; <a href="mailto:%s">ဝဘ်စီမံခန့်ခွဲသူထံ</a>ဆက်သွယ်ပါ !','<strong>ERROR</strong>: This email is already registered, please choose another one.'=>'<strong>မှားနေသည်။</strong>: ဤ e-mail ဖြင့် မှတ်ပုံတင်ပြီးဖြစ်သည်။ အခြားလိပ်စာတစ်ခုကိုရွေးပါ။','<strong>ERROR</strong>: The email address isn&#8217;t correct.'=>'<strong>မှားနေသည်။</strong>: E-mail လိပ်စာမမှန်ပါ။','<strong>ERROR</strong>: Please type your e-mail address.'=>'<strong>မှားနေသည်။</strong>: သင့် e-mail လိပ်စာဖြည့်ပါ။','<strong>ERROR</strong>: This username is already registered. Please choose another one.'=>'<strong>အမှား</strong> - ဒီသုံးသူအမည်ဖြင့် မှတ်ပုံတင်ပြီးဖြစ်သည်။ အခြားအမည်တစ်ခုကိုရွေးပါ။','<strong>ERROR</strong>: This username is invalid because it uses illegal characters. Please enter a valid username.'=>'<strong>မှားနေသည်။</strong>: အသုံးပြုခွင့်မရှိသော အက္ခရာများကို သုံးထားသဖြင့် ဤသုံးသူအမည် မမှန်ပါ။ မှန်ကန်သော သုံးသူအမည်ကိုဖြည့်ပါ။','<strong>ERROR</strong>: Please enter a username.'=>'<strong>မှားနေသည်။</strong>: သုံးသူ အမည်ဖြည့်ပါ။','Invalid key'=>'သင့်လျှော်မှန်ကန်မှုမရှိသော သော့ချက်','Hint: The password should be at least seven characters long. To make it stronger, use upper and lower case letters, numbers, and symbols like ! " ? $ % ^ &amp; ).'=>'မှတ်ချက် - စကားဝှက်သည် အနည်းဆုံး အက္ခရာ ၇ လုံးရှိသင့်သည်။ ပိုမို လုံခြုံမှုရစေရန် အက္ခရာအကြီး၊ အသေး၊ သင်္ချာဂဏန်းများနှင့် ! " ? $ % ^ &amp; ) တို့ကဲ့သို့သော သင်္ကေတများအား သုံးပါ။','Jabber / Google Talk'=>'Jabber / Google Talk','Yahoo IM'=>'Yahoo IM','AIM'=>'AIM','Invalid user ID.'=>'သုံးသူ ID သင့်လျော်မှုမရှိပါ။','Display name based on first name and last name%1$s %2$s'=>'%1$s %2$s','Cannot create a user with an empty login name.'=>'သုံးသူ အမည် အလွတ်ဖြင့် သုံးသူအသစ်ပြုလုပ်၍ မရပါ။','<strong>ERROR</strong>: Your account has been marked as a spammer.'=>'<strong>မှားယွင်းမှု</strong> - သင့်သုံးသူစာရင်းကို အနှောက်အယှက်ပေးသူအဖြစ်သတ်မှတ်ထားသည်။','<strong>ERROR</strong>: The password you entered for the username <strong>%1$s</strong> is incorrect. <a href="%2$s">Lost your password?</a>'=>'<strong>ERROR</strong>: ဤ အသုံးပြုသူ အတွက် သင်ရိုက်သွင်းသော စကားဝှက် <strong>%1$s</strong> မမှန်ပါ။ <a href="%2$s">စကားဝှက်ပျောက်သွားပြီလား?</a>','<strong>ERROR</strong>: Invalid username. <a href="%s">Lost your password?</a>'=>'<strong>ERROR-အမှား</strong>:အခွင့်မရသော အသုံးပြုသူအမည်. <a href="%s">စကားဝှက်ပျောက်နေသလား?</a>','<strong>ERROR</strong>: The password field is empty.'=>'<strong>မှားနေသည်။</strong>: စကားဝှက် နေရာလွတ်နေသည်။','<strong>ERROR</strong>: The username field is empty.'=>'<strong>မှားနေသည်။</strong>: သုံးသူအမည် နေရာလွတ်နေသည်။','Translation Updates'=>'နောက်ဆုံးဘာသာပြန်ချက်များကိုရယူပါ။','%d Theme Update'=>'အခင်းအကျင်း %d ခု အသစ်' . "\0" . 'အခင်းအကျင်း %d ခု အသစ် ','%d Plugin Update'=>'ပလပ်အင် %d ခု အဆင့်မြှင့်မှု' . "\0" . 'ပလပ်အင် %d ခု အဆင့်မြှင့်မှုများ ','%d WordPress Update'=>'WordPress %d ခု အသစ်','(WordPress could not establish a secure connection to WordPress.org. Please contact your server administrator.)'=>'(WordPress မှ WordPress.org သို့ လုံခြုံစိတ်ချရသော ဆက်သွယ်မှု မတည်ဆောက်နိုင်ပါ။ သင့်ဆာဗာ စီမံ့ခန့်ခွဲသူအား ဆက်သွယ်ပါ။)','An unexpected error occurred. Something may be wrong with WordPress.org or this server&#8217;s configuration. If you continue to have problems, please try the <a href="https://wordpress.org/support/">support forums</a>.'=>'မမျှော်လင့်သော အမှားအယွင်းဖြစ်ပွားခဲ့သည်။ WordPress.org သို့မဟုတ် ဒီဆာဗာ သတ်မှတ်ချက်များတွင် တစ်ခုခုမှားယွင်းမှု ဖြစ်နိုင်သည်။ ပြဿနာဆက်လက်ဖြစ်ပွားနေလျှင် <a href="https://mya.forums.wordpress.org/support/">ကူညီပံ့ပိုးမှု ဖိုရမ်များ</a> သို့ သွားကြည့်ပါ။','Customizer'=>'ပြင်ဆင်ပြောင်းလဲသူ','Theme support for %1$s should be registered before the %2$s hook.'=>'%1$s အတွက် အခင်းအကျင်း ပံ့ပိုးမှုသည် %2$s hook မတိုင်ခင် မှတ်ပုံတင်ထားပြီး ဖြစ်သင့်သည်။','You need to pass an array of types.'=>'အမျိုးအစားများ၏ array အား ပေးပို့ရန် လိုအပ်သည်။','XFN'=>'XFN','XHTML Friends Network'=>'XHTML မိတ်ဆွေများ ကွန်ယက်','Valid <abbr title="eXtensible HyperText Markup Language">XHTML</abbr>'=>'သင့်လျှော်မှန်ကန်သော <abbr title="eXtensible HyperText Markup Language">XHTML</abbr>','This page validates as XHTML 1.0 Transitional'=>'ဒီစာမျက်နှာသည် XHTML 1.0 Transitional နှင့် ညီညွတ်ကြောင်း သက်သေခံသည်','You are currently browsing the <a href="%1$s/">%2$s</a> blog archives.'=>'ဆိုဒ်မော်ကွန်းမှတ်တမ်း<a href="%1$s/">%2$s</a>ကို သင်ယခုကြည့်ရှုနေသည်။','You have searched the <a href="%1$s/">%2$s</a> blog archives for <strong>&#8216;%3$s&#8217;</strong>. If you are unable to find anything in these search results, you can try one of these links.'=>'<strong>&#8216;%3$s&#8217;</strong>အတွက်ဆိုဒ်မော်ကွန်းမှတ်တမ်း<a href="%1$s/">%2$s</a>ကို သင်ရှာဖွေခဲ့သည်။ ရှာဖွေမှုရလဒ်အတွင်း တစ်စုံတစ်ခုမျှရှာမတွေ့ခဲ့လျှင် ဤလိပ်စာများမှ တစ်ခုကို ကြိုးစားစမ်းကြည့်နိုင်သည်။','You are currently browsing the <a href="%1$s/">%2$s</a> blog archives for the year %3$s.'=>'%3$s ခုနှစ်အတွက် ဆိုဒ်မှတ်တမ်းမော်ကွန်း<a href="%1$s/">%2$s</a>ကို သင်ယခုကြည့်ရှုနေသည်။','F, Y'=>'Fလ၊ Yခုနှစ်','You are currently browsing the <a href="%1$s/">%2$s</a> blog archives for %3$s.'=>'%3$s အတွက် ဆိုဒ်မော်ကွန်းမှတ်တမ်း<a hre