,'Username must be at least 4 characters.'=>'သုံးသူအမည်တွင် အနည်းဆုံး အက္ခရာ ၄ လုံးပါရမည်။','You cannot use that email address to signup. We are having problems with them blocking some of our email. Please use another email provider.'=>'ဒီ အီးမေးလ်လိပ်စာဖြင့် စာရင်းသွင်းခြင်း မပြုလုပ်နိုင်ပါ။ ကျွန်ုပ်တို့၏ အီးမေးလ်တစ်ချို့ကို ပိတ်ဆို့မှုကြောင့် သူတို့နှင့် ကျွန်ုပ်တို့ ပြဿနာဖြစ်နေပါသည်။ အခြား အီးမေးလ် ပံ့ပိုးသူကို အသုံးပြုပါ။','That username is not allowed.'=>'ဒီအမည်ကို ခွင့်မပြုပါ။','Please enter a username.'=>'သုံးသူအမည်တစ်ခု ဖြည့်သွင်းပါ။','Only lowercase letters (a-z) and numbers are allowed.'=>'စာလုံးအသေး (a-z) နှင့် နံပါတ်များသာ သုံးခွင့်ပြုသည်။','<strong>ERROR</strong>: problem creating site entry.'=>'<strong>အမှား</strong> - ဆိုဒ် အချက်အလက်များ ဖန်တီးစဉ် ပြဿနာရှိပါသည်။','<strong>ERROR</strong>: Site URL already taken.'=>'<strong>အမှား</strong> - ဆိုဒ် URL ကို သုံးစွဲနေသူ ရှိပါသည်။','That user does not exist.'=>'ဒီသုံးသူ မရှိသေးပါ။','The requested user does not exist.'=>'တောင်းဆိုသော သုံးသူမရှိပါ။','<strong>Conflicting values for the constants VHOST and SUBDOMAIN_INSTALL.</strong> The value of SUBDOMAIN_INSTALL will be assumed to be your subdomain configuration setting.'=>'<strong>ကိန်းသေကုတ် VHOST နှင့် SUBDOMAIN_INSTALL အတွက် တန်ဖိုးများ ပဋိပက္ခဖြစ်နေသည်။</strong> SUBDOMAIN_INSTALL ၏ တန်ဖိုးကို သင့် ဒိုမိန်းခွဲ သတ်မှတ်ချက် သတ်မှတ်ချက် အဖြစ်ယူဆ အသုံးပြုပါမည်။ ','The constant <code>VHOST</code> <strong>is deprecated</strong>. Use the boolean constant <code>SUBDOMAIN_INSTALL</code> in wp-config.php to enable a subdomain configuration. Use is_subdomain_install() to check whether a subdomain configuration is enabled.'=>'ကိန်းသေကုတ် <code>VHOST</code>ကို <strong>ဖယ်ရှားမည့် စာရင်းသွင်းထားပြီ</strong>။ ဒိုမိန်းခွဲ သတ်မှတ်ချက်ကို ဖွင့်ထားရန် wp-config.php တွင် <code>SUBDOMAIN_INSTALL</code>ဘူးလီယန် ကိန်းသေကုတ်ကို သုံးပါ။ ဒိုမိန်းခွဲ သတ်မှတ်ချက် ဖွင့်ထားမထား သိနိုင်ရန် is_subdomain_install() ကို သုံး၍ စစ်ဆေးပါ။','Add to Video Playlist'=>'ဗွီဒီယိုစာရင်းသို့ ထည့်ရန်',