gument has changed to an array to match the behavior of the other cron functions.'=>'အခြား cron လုပ်ဆောင်ချက်များနဲ့ ဆောင်ရွတ်ပုံနဲ့ ကိုက်ညီဖို့ ဒီ argument ကို array တခုအဖြစ် ပြောင်းလိုက်ပြီ။','Could not update comment status'=>'မှတ်ချက် အ‌ခြေအ‌နေအား အသစ်ပြုပြင်ဖြည့်စွက်၍ မရပါ။','You are posting comments too quickly. Slow down.'=>'မှတ်ချက်များကို အရမ်းမြန်မြန် သင်ရေးနေသည်။ ဖြည်းဖြည်းလုပ်ပါ။','Duplicate comment detected; it looks as though you&#8217;ve already said that!'=>'ပုံစံတူ မှတ်ချက်ကို တွေ့ပါသည်။ သင်ဒီအတိုင်း ရေးသားပြောဆိုခဲ့ပြီး ဖြစ်သည်ဟုယူဆရသည်။','adjectiveSpam'=>'နှောက်ယှက်သော','adjectiveApproved'=>'အတည်ပြုပြီး','Unapproved'=>'အတည်ပြုမထားပါ','Post Comment'=>'မှတ်ချက် ပေးပို့ပါ','Cancel reply'=>'ပြန်စာ ပယ်ဖျက်ပါ','You may use these <abbr title="HyperText Markup Language">HTML</abbr> tags and attributes: %s'=>'ဒီ <abbr title="HyperText Markup Language">HTML</abbr>သင်္ကေတများနှင့် အထူးပြုချက်များကို အသုံးပြုနိုင်သည် - %s','Your email address will not be published.'=>'သင့် email လိပ်စာကို ဖော်ပြမည် မဟုတ်ပါ။','Logged in as <a href="%1$s">%2$s</a>. <a href="%3$s" title="Log out of this account">Log out?</a>'=>'<a href="%1$s">%2$s</a>အဖြစ်ဝင်ရောက်ထားသည်။ <a href="%3$s" title="Log out of this account">ထွက်မည် &raquo;</a>','You must be <a href="%s">logged in</a> to post a comment.'=>'မှတ်ချက်ရေးရန် အသင်းဝင် အဖြစ် <a href="%s">ဝင်ရောက် </a>ပြီးဖြစ်ရမည်။','Required fields are marked %s'=>'လိုအပ်သော ကွက်လပ်များကို %s ဖြင့်မှတ်သားထားသည်','Website'=>'ဝက်ဘ်ဆိုဒ်','Email'=>'အီးမေးလ်','Name'=>'အမည်','1: date, 2: time%1$s at %2$s'=>'%1$s နေ့ %2$s အချိန်','%s <span class="says">says:</span>'=>'%s <span class="says">ကပြောသည် - </span>','(Edit)'=>'(ပြုပြင်) ','%1$s at %2$s'=>'%1$s ရက်နေ့ %2$s  ','Your comment is awaiting moderation.'=>'သင့်မှတ်ချက်သည် စစ်ဆေးကွပ်ကဲမှုကို စောင့်နေသည်။','<cite class="fn">%s</cite> <span class="says">says:</span>'=>'<cite class="fn">%s</cite> <span class="says">က ပြောသည် - </span>','Pingback:'=>'ချိတ်ဆက်မှုပြန်လှန်အသိပေးချက် - ','Leave a Reply to %s'=>' %s ကိုပြန်စာထားခဲ့ပါ။','Leave a Reply'=>'ပြန်စာထားခဲ့ပါ။','Click here to cancel reply.'=>'ပြန်စာအား ပယ်ဖျက်ရန် ဤနေရာကို နှိပ်ပါ။','Log in to leave a Comment'=>'မှတ်ချက်ပေးရန် အသင်းဝင် အဖြစ်ဝင်ရောက်ပါ။','Leave a Comment'=>'မှတ်ချက်ပေးခဲ့ပါ။','Log in to Reply'=>'ပြန်စာရေးရန် အသင်းဝင် အဖြစ်ဝင်ရောက်ပါ။','Reply to %s'=>' %s ထံ စာပြန်ရန်','Reply'=>'ပြန်စာရေးပါ။','Enter your password to view comments.'=>'မှတ်ချက်များကိုကြည့်ရန် သင်၏စကားဝှက်ကို ဖြည့်ပါ။','%1$s Comment<span class="screen-reader-text"> on %2$s</span>'=>'Singular: %1$s ကွန်မင့်<span class="screen-reader-text"> on %2$s</span>' . "\0" . 'Plural: %1$s ကွန်မင့်များ<span class="screen-reader-text"> on %2$s</span>','Comments Off<span class="screen-reader-text"> on %s</span>'=>'ကွန်မင့်များပိတ်ထား<span class="screen-reader-text"> on %s</span>','1 Comment<span class="screen-reader-text"> on %s</span>'=>'ကွန်မင့် ၁ ခု<span class="screen-reader-text"> on %s</span>','No Comments<span class="screen-reader-text"> on %s</span>'=>'ကွန်မင့်မရှိ <span class="screen-reader-text"> on %s</span>','Use <code>get_trackback_url()</code> instead if you do not want the value echoed.'=>'ပဲတင်ထပ် တန်ဖိုးကို မလိုချင်လျှင် <code>get_trackback_url()</code> ကို အစားထိုးသုံးပါ','Pingback'=>'ချိတ်ဆက်မှု အပြန်အလှန် အသိပေးချက်','Trackback'=>'ချိတ်ဆက်မှု လိုက်လံ အသိပေးချက်','nounComment'=>'မှတ်ချက်','1 Comment'=>'မှတ်ချက် ၁ ခု ','No Comments'=>'မှတ်ချက်များ မရှိပါ။','% Comments'=>'မှတ်ချက်များ % ခု ','The specified target URL does not exist.'=>'သတ်မှတ်ထားတဲ့ ရည်မှန်းချက် တည်နေရာ မရှိပါ။','Pingback from %1$s to %2$s registered. Keep the web talking! :-)'=>'%1$s မှ %2$s သို့ ချိတ်ဆက်မှု အပြန်အလှန်အသိပေးချက်ကို မှတ်ပုံတင်ထားပြီ။ ကွန်ရက်ကို စကားဆက် ပြောစေပါ။ :-)','The source URL does not contain a link to the target URL, and so cannot be used as a source.'=>'အရင်းအမြစ် တည်နေရာမှာ ရည်မှန်းချက် တည်နေရာဆီ အချိတ်အဆက် တခု မပါပါ၊ ဒါကြောင့် အရင်းအမြစ် တခုအဖြစ် မသုံးနိုင်ပါ။','We cannot find a title on that page.'=>'ထိုစာမျက်နှာပေါ်တွင် ခေါင်းစဉ