rry, you cannot list users.'=>'သုံးသူစာရင်းကို သင်ကြည့်ရှု၍ မရနိုင်ပါ။','Invalid user ID'=>'သင့်လျှော်မှန်ကန်မှု မရှိသော သုံးသူ ID ','Sorry, you cannot edit users.'=>'သုံးသူများကို သင် ပြုပြင်၍ မရပါ။','You are not allowed to assign terms in this taxonomy.'=>'ဒီဝေါဟာရအုပ်စုရှိ စကားလုံးများကို သင် သတ်မှတ်ပေးခွင့်မရှိပါ။','Sorry, deleting the term failed.'=>'စကားလုံးကို ဖျက်ခြင်း မအောင်မြင်ပါ။','You are not allowed to delete terms in this taxonomy.'=>'ဒီဝေါဟာရအုပ်စုအတွင်းမှ စကားလုံးများကို သင်ဖျက်ခွင့်မရှိပါ။','Sorry, editing the term failed.'=>'စကားလုံးကို ပြုပြင်ခြင်း မအောင်မြင်ပါ။','This taxonomy is not hierarchical so you can\'t set a parent.'=>'ဒီဝေါဟာရအုပ်စုကို အစဉ်အဆက် အုပ်စုဖွဲ့ မရပါ။ ထို့ကြောင့် မူလအုပ်စု သတ်မှတ်ပေး၍ မရပါ။','You are not allowed to edit terms in this taxonomy.'=>'ဒီဝေါဟာရအုပ်စုရှိ စကားလုံးများကို ပြုပြင်ရန် သင့်ကိုခွင့်မပြုပါ။','Sorry, your term could not be created. Something wrong happened.'=>'စကားလုံး ဖြည့်သွင်း၍မရပါ။ အမှားအယွင်းတစ်ခုခု ဖြစ်ပွားခဲ့သည်။','Parent term does not exist.'=>'မူလအုပ်စု စကားလုံး မရှိပါ။','This taxonomy is not hierarchical.'=>'ဒီဝေါဟာရ အုပ်စုကို အစဉ်အဆက် အုပ်စုခွဲ၍မရပါ။','The term name cannot be empty.'=>'သတ်မှတ်ချက်စကားလုံး အမည်ကို ကွက်လပ်ထား၍မရပါ။','You are not allowed to create terms in this taxonomy.'=>'ဒီဝေါဟာရ အုပ်စုတွင် စကားလုံးအသစ်များ ထပ်ဖြည့်ရန် သင့်ကို ခွင့်မပြုပါ။','Invalid taxonomy'=>'သင့်လျှော်မှန်ကန်မှုမရှိသော  မျိုးခွဲစနစ် ','Sorry, you are not allowed to edit posts in this post type'=>'ဒီစာမူအမျိုးအစားမှ စာမူများကို သင်ပြုပြင်ခွင့်မရှိပါ။','The post type specified is not valid'=>'သတ်မှတ်ပေးသော စာမူအမျိုးအစား သင့်လျှော်မှန်ကန်မှု မရှိပါ','Sorry, you cannot edit this post.'=>'ဤစာမူကို ပြုပြင်ဖြည့်စွက်ခွင့် သင့်မှာမရှိပါ။','The post cannot be deleted.'=>'စာမူကို ဖျက်၍ မရနိုင်ပါ။','Sorry, you are not allowed to delete this post.'=>'ဒီစာမူကို သင်ဖျက်ခွင့်မရှိပါ။','There is a revision of this post that is more recent.'=>'ဤစာမူထက် ပိုမိုသစ်လွင်သော စာမူတစ်ပုဒ် ပြန်လှန်စစ်ဆေးရန် စာရင်းတွင်ရှိပါသည်။','Sorry, your entry could not be posted. Something wrong happened.'=>'သင့် ထည့်သွင်းမှုအား ဖော်ပြ၍မရနိုင်ပါ။ အမှားအယွင်း တစ်ခုခု ဖြစ်ပွားထားသည်။','Sorry, you are not allowed to add a term to one of the given taxonomies.'=>'ပေးထားသော ဝေါဟာရအုပ်စုသို့ ဝေါဟာရတစ်ခု ဖြည့်သွင်းရန် သင့်ကို ခွင့်ပြုမထားပါ။','Ambiguous term name used in a hierarchical taxonomy. Please use term ID instead.'=>'အစဉ်အဆက် ဝေါဟာရ အုပ်စုတွင် အသုံးပြုရန် ရည်ရွယ်ချက်ပြည့်စုံသည့် ဝေါဟာရအမည်။ ဝေါဟာရ ID ကို အစားထိုးသုံးပေးပါ။','Invalid term ID'=>'သတ်မှတ်ချက် စာလုံး ID သင့်လျှော်မှန်ကန်မှုမရှိပါ။ ','Sorry, you are not allowed to assign a term to one of the given taxonomies.'=>'ပေးထားသော ဝေါဟာရအုပ်စုတွင် ဝေါဟာရတစ်ခု သတ်မှတ်ထည့်သွင်းရန် သင့်ကို ခွင့်မပြုပါ။','Sorry, one of the given taxonomies is not supported by the post type.'=>'ပေးထားသော ဝေါဟာရအုပ်စုကို ဒီစာမူအမျိုးအစားမှ မထောက်ပံ့ပါ။','Invalid attachment ID.'=>'တွဲချိတ်မှု ID သင့်လျှော်မှန်ကန်မှုမရှိပါ။ ','Sorry, you are not allowed to stick this post.'=>'ဒီစာမူကို တွဲချိတ်ဖော်ပြရန် သင့်ကို ခွင့်မပြုပါ။','Sorry, you cannot stick a private post.'=>'သီးသန့်စာမူတစ်ခုကို တွဲချိတ်ဖော်ပြ၍ မရပါ။','Invalid author ID.'=>'စာရေးသူ ID သင့်လျှော်မှန်ကန်မှု မရှိပါ။','You are not allowed to create posts as this user.'=>'ဒီသုံးသူအနေဖြင့် စာမူများအသစ်ပြုလုပ်ရေးသားရန် သင့်ကို ခွင့်မပြုပါ။','Sorry, you are not allowed to create password protected posts in this post type'=>'ဒီစာမူအမျိုးအစားတွင် စကားဝှက်ဖြင့်ပိတ်ထားသော စာမူများ အသစ်ပြုလုပ်ရေးသားရန် သင့်ကို ခွင့်မပြုပါ။','Sorry, you are not allowed to publish posts in this post type'=>'ဒီစာမူအမျိုးအစားတွင် စာမူများ ထုတ်ဝေရန် သင့်ကို ခွင့်မပြုပါ။','Sorry, you are not allowed to create private posts in this post type'=>'ဒီစာမူအမျိုးအစားတွင် သီးသန့်စာမူများ အသစ်ပြုလုပ်ရေးသားရန် သင့်ကို ခွင့်မပြုပါ။','Sorry, you are not allowed to post on this site.'=>'ဤဆိုဒ်တွင် စာမူရေးသားခွင့် သင့်မှာမရှိပါ။','The post type may not be changed.'=>'စာမူအမျိုးအစားကို ပြောင်းလဲ၍မရနိုင်ပါ။','Sorry, you are not allowed to edit this post.'=>'ဒီစာမူကို သင်ပြုပြ