s" အခင်းအကျင်းမှာ သင့်လျှော်မှန်ကန်သော မူလ အခင်းအကျင်းမဟုတ်ပါ။','The parent theme is missing. Please install the "%s" parent theme.'=>'ပင်မ အခင်းအကျင်းပျောက်နေသည်။ "%s" ပင်မ အခင်းအကျင်းကို ထည့်သွင်းပါ။','Template is missing.'=>'တန်းပလပ်(စံပုံစံ) ပျောက်နေသည်။','Stylesheet is not readable.'=>'စတိုင်စာရွက်ကို ဖတ်၍မရပါ။','ERROR: The themes directory is either empty or doesn&#8217;t exist. Please check your installation.'=>'အမှား - အခင်းအကျင်းများ တည်နေရာညွှန်းမရှိပါ သို့မဟုတ် အလွတ်ဖြစ်နေသည်။ သင့်ထည့်သွင်းမှုကို စစ်ဆေးကြည့်ပါ။','Stylesheet is missing.'=>'စတိုင်စာရွက် ပျောက်နေသည်။','The theme directory "%s" does not exist.'=>'တန်းပလတ်ထည့်ထားသည့်ဖိုဒါ "%s" မရှိပါ။','Attempted to set image quality outside of the range [1,100].'=>'ရုပ်ပုံအရည်အသွေးအား ကန့်သတ် အတိုင်းအတာ အပိုင်းအခြား [၁ မှ ၁၀၀] ၏ အပြင်ဘက်ဖြင့် သတ်မှတ်ရန် ကြိုးစားခဲ့သည်။','Could not read image size'=>'ပုံအရွယ်အစားအားမဖတ်နိုင်ပါ။','Image Editor Save Failed'=>'ရုပ်ပုံ ပြုပြင်စနစ် သိမ်းဆည်းမှု မအောင်မြင်ပါ','Image flip failed.'=>'ရုပ်ပုံ ပြောင်းပြန်လှန်ခြင်း မအောင်မြင်ပါ။','Image rotate failed.'=>'ရုပ်ပုံ တစ်ပတ်လှည့်ခြင်း မအောင်မြင်ပါ။','Image crop failed.'=>'ရုပ်ပုံ ပိုင်းဖြတ်ခြင်း မအောင်မြင်ပါ။','Could not calculate resized image dimensions'=>'အရွယ်ပြောင်းလိုက်သော ရုပ်ပုံ၏ အတိုင်းအထွာများကို တွက်ချက်၍ မရနိုင်ပါ','Image resize failed.'=>'ရုပ်ပုံ အရွယ်ပြောင်းခြင်း မအောင်မြင်ပါ။','Could not read image size.'=>'ရုပ်ပုံအရွယ်အစားကို ဖတ်၍ မရပါ။','File is not an image.'=>'ဒီဖိုင်သည် ရုပ်ပုံဖိုင်တစ်ခုမဟုတ်ပါ။','File doesn&#8217;t exist?'=>'ဖိုင်မရှိဘူးလား။','Add Link'=>'လိပ်စာ ထည့်ပါ။','Search or use up and down arrow keys to select an item.'=>'ရှာပါ သို့မဟုတ် တစ်ခုခုကိုရွေးရန် အထက်၊ အောက်မြှားအား သုံးပါ။','No search term specified. Showing recent items.'=>'ရှာဖွေရန် စကားလုံး သတ်မှတ်ပေးမထားပါ။ လတ်တလော အရာများကို ဖော်ပြပေးထားသည်။','Or link to existing content'=>'သို့မဟုတ် ရှိပြီးသော အကြောင်းအရာကို ချိတ်ဆက်ပါ။','Open link in a new window/tab'=>'လိပ်စာကို ဖန်သားပြင်ပြတင်း/ခလုပ်ပြား အသစ်တွင်ဖွင့်ပါ','Link Text'=>'ချိတ်ဆက်လိပ