dpress.org/'=>'https://codex.wordpress.org/','Documentation'=>'လမ်းညွှန်ချက်စာတမ်း','https://wordpress.org/'=>'https:/mya.wordpress.org/','WordPress.org'=>'mya.WordPress.org','About WordPress'=>'WordPress အကြောင်း','<strong>ERROR</strong>: The comment could not be saved. Please try again later.'=>'<strong>အမှား</strong> -  မှတ်ချက်သိမ်း၍ မရပါ။ နောက်တစ်ကြိမ်စမ်းကြည့်ပါ။','<strong>ERROR</strong>: please type a comment.'=>'<strong>အမှား</strong> - မှတ်ချက်တစ်ခု ရေးသွင်းပါ။','<strong>ERROR</strong>: please enter a valid email address.'=>'<strong>အမှား</strong> - သင့်လျော်မှန်ကန်မှုရှိသော အီးမေးလ် လိပ်စာ ဖြည့်သွင်းပါ။','<strong>ERROR</strong>: please fill the required fields (name, email).'=>'<strong>အမှား</strong> - လိုအပ်သော ကွက်လပ်များကို ဖြည့်စွက်ပါ (အမည်၊ အီးမေးလ်)။','Sorry, you must be logged in to post a comment.'=>'မှတ်ချက်တစ်ခုရေးရန် အသင်းဝင် အ‌နေဖြင့် ဝင်ရောက်ထားရမည်။','Sorry, comments are closed for this item.'=>'ဤအရာအတွက် မှတ်ချက်ပေးမှုများအား ပိတ်ထားပြီးပါပြီ။','Your account is now activated. <a href="%1$s">Log in</a> or go back to the <a href="%2$s">homepage</a>.'=>'သင့်သုံးသူစာရင်း အသက်ဝင်ပြီဖြစ်ပါသည်။ <a href="%1$s">ဝင်ပါ</a> သို့မဟုတ် <a href="%2$s">အဖွင့်စာမျက်နှာ</a>သို့ ပြန်သွားပါ။','Your account is now activated. <a href="%1$s">View your site</a> or <a href="%2$s">Log in</a>'=>'သင့်သုံးသူစာရင်း အသက်ဝင်ပါပြီ။ <a href="%1$s">သင့်ဆိုဒ်ကို ကြည့်ပါ</a> သို့မဟုတ် <a href="%2$s">ဝင်ပါ</a>','Password:'=>'စကားဝှက် - ','Username:'=>'သုံးသူအမည် - ','An error occurred during the activation'=>'အသက်သွင်းမှုလုပ်ဆောင်စဉ် အမှားအယွင်း ဖြစ်ပွားခဲ့သည်','Your site at <a href="%1$s">%2$s</a> is active. You may now log in to your site using your chosen username of &#8220;%3$s&#8221;. Please check your email inbox at %4$s for your password and login instructions. If you do not receive an email, please check your junk or spam folder. If you still do not receive an email within an hour, you can <a href="%5$s">reset your password</a>.'=>'<a href="%1$s">%2$s</a> ရှိ သင့်ဆိုဒ် စ